import React from 'react'
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'
import { Login } from './views/'

function App() {
	return (
		<Router>
			<div>
				<Routes>
					<Route exact path={['/', '/login']} component={Login} />
					{/* <Route exact path='/summary' component={SummaryPage} /> */}
				</Routes>
			</div>
		</Router>
	)
}

export default App
